import React from 'react';
import styled from 'styled-components';

const ContactSection = styled.div`
  display: flex;
  background: #333;
  color: white;
  padding: 50px;
`;

const FormWrapper = styled.div`
  flex: 1;
  margin-right: 50px;
  background: #444;
  padding: 30px;
  border-radius: 8px;
`;

const ContactDetails = styled.div`
  flex: 1;
  background: #555;
  padding: 30px;
  border-radius: 8px;
`;

const Input = styled.input`
  width: 100%;
  padding: 10px;
  margin-bottom: 20px;
  background: #666;
  border: none;
  border-radius: 4px;
  color: #fff;
`;

const TextArea = styled.textarea`
  width: 100%;
  padding: 10px;
  margin-bottom: 20px;
  background: #666;
  border: none;
  border-radius: 4px;
  color: #fff;
  height: 150px;
`;

const Button = styled.button`
  padding: 10px 20px;
  background: #000;
  color: #fff;
  border: none;
  border-radius: 4px;
  cursor: pointer;

  &:hover {
    background: #777;
  }
`;

const Contact = () => {
  return (
    <ContactSection>
      <FormWrapper>
        <h2>Contact Me</h2>
        <form>
          <Input type="text" placeholder="Your Name" />
          <Input type="email" placeholder="Your Email" />
          <TextArea placeholder="Your Message" />
          <Button type="submit">Send Message</Button>
        </form>
      </FormWrapper>
      <ContactDetails>
        <h3>Contact Information</h3>
        <p>Phone: (123) 456-7890</p>
        <p>Email: contact@example.com</p>
        <div>
          {/* Social media icons */}
        </div>
        {/* Optionally include a map */}
      </ContactDetails>
    </ContactSection>
  );
};

export default Contact;
